import React, { Component } from 'react'
import axios  from 'axios';
export class PhotoList extends Component {
constructor(props) {
  super(props)

  this.state = {
     photos:[]
  }
}
componentDidMount(){
    this.handlePhotoList();
}
handlePhotoList=async()=>{
   await axios.get("https://jsonplaceholder.typicode.com/photos").then(res=>{
    if(res){
       this.setState({photos:res.data})
    }
   }).catch(err=>console.log(err,"error"))
}
  render() {
    return (
    //   <div>PhotoList</div>
       <React.Fragment >
           <div className='container-fluid'>
              <div className='row'>
                   {
                       this.state.photos.length>0?this.state.photos.map((photo)=>{
                       return(
                        <div className="card col-md-2"  key={photo.id}>
                        <img src="..." className="card-img-top" alt="..." />
                        <div className="card-body">
                          <h5 className="card-title">Card title</h5>
                          <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                          <a href="#" className="btn btn-primary">Go somewhere</a>
                        </div>
                      </div>
                       )
                       }):""
                   }
              </div>
           </div>
       </React.Fragment>
    )
  }
}

export default PhotoList
